import React, { Component } from 'react';
import './Services.css'


class Services extends Component{
    render(){
        return(
            <div className="services" >
                <h3>MY WORK</h3>
                <p>I was never the best in school or academic but I am a very curious person, especially in how things work around me. My interest in computer really began to grow when I get to write my first line of code in Python. Despite I am not the best in drawing or crafting, through coding I was able to fulfil my passion for creating and inventing on  my own. </p>
                <div className="row">
                    <Icons icon={iconObj[0].icon} title={iconObj[0].title} description={iconObj[0].description} />
                    <Icons icon={iconObj[1].icon} title={iconObj[1].title} description={iconObj[1].description} />
                    <Icons icon={iconObj[2].icon} title={iconObj[2].title} description={iconObj[2].description} />
                    <Icons icon={iconObj[3].icon} title={iconObj[3].title} description={iconObj[3].description} />

                </div>
            </div>
        );
    }
}

const iconObj = [
    {
        icon: <ion-icon name="phone-portrait-outline"></ion-icon>,
        title: 'Software Development',
        description: 'Look great on any screen size'
    },
    {
        icon: <ion-icon name="pencil-outline"></ion-icon>,
        title: 'Mobile Application',
        description: 'Freshly redesinged with BootStrap 4'
    },
    {
        icon: <ion-icon name="thumbs-up-outline"></ion-icon>,
        title: 'Data Strategy',
        description: 'This will be changed'

    },
    {
        icon: <ion-icon name="help-circle-outline"></ion-icon>,
        title: 'Community',
        description: 'Let me know'
    }
];

class Icons extends Component{
    render(){
        return(
            <div>
                <span>
                    {this.props.icon}
                </span>
                <h4>{this.props.title}</h4>
                <p>{this.props.description}</p>
            </div>

        );
    }
}
export default Services;
